import axios from 'axios'

const todosPersonajes = async (state) => {
    const peticion = await axios.get('https://rickandmortyapi.com/api/character');
    state(peticion.data.results)
}

const unicoPersonaje = async (id, state) => {
    const peticion = await axios.get(`https://rickandmortyapi.com/api/character/${id}`);
    state(peticion.data)
} 

const signup = async (state) => {
    const peticion = await axios.post('http://localhost:9090/auth/signup',{
        email:'oscar.ramirez@gmail.com',
        password:'mypassword',
        fullName:'Oscar Ramirez Garcia'
    },{
        headers:{
            'Access-Control-Allow-Origin': '*',
            'Access-Control-Allow-Headers': 'Origin, X-Requested-With, Content-Type, Accept'
        }
    })
    .then((res)=> console.log(res.data))
    .catch((err)=>console.error(err));

}

export {
    todosPersonajes,
    unicoPersonaje,
    signup
}
